INSERT INTO `school` VALUES (1,2691,'重庆交通职业学院','●中央财政支持国家级实验基地●重庆交通大学合作办学单位',10028,'重庆'),(2,1474,'重庆大学城市科技学院','spanstyle=\"font-si',10028,'重庆'),(3,1476,'重庆邮电大学移通学院','重庆邮电大学移通学院',10028,'重庆'),(4,493,'许昌学院','许昌学院是一所省属全日制普通本科院校。学校坐落于汉魏故都——河南省许昌市。许昌地处中原腹地，既是一座历史悠久的文化名城，又是一座蓬勃发展的现代新城。许昌三国文化底蕴深',10017,'河南'),(5,1888,'厦门大学嘉庚学院','imgalt=\"\"src=\"/userfiles/Image/images/1496720055440puk.jpg\"style=',10024,'福建'),(6,1506,'黎明职业大学','黎明职业大学创办于1984年，是福建省泉州市人民政府举办的公办全日制综合性高职院校，福建省首批示范性高职院校、省文明学校、省示范性现代职业院校建设工程培育校，全国职业院校数字校园建设实验校、',10024,'福建'),(7,664,'上海出版印刷高等专科学校','历史悠久，部市共建——学校创建于1953年，是新中国建立最早的出版印刷类高等学校，在行业中享有盛誉，是全国唯一的部市共建的高专，60多年来为我国的出版印刷业培养了数万名高',10000,'上海'),(8,1890,'福建师范大学协和学院','福建师范大学协和学院是由福建师范大学与有关企事业联合申办，2003年5月经福建省人民政府批准创办，2003年12月通过教育部首批确认的独立学院。学院实施全日制本科教育，独立颁发国家承认学历的',10024,'福建'),(9,1488,'重庆电子工程职业学院','重庆电子工程职业学院是由重庆市政府举办、重庆市教委主管、市教委与市经信委共建的全日制普通高等院校。学校创建于1965年，1999年成为重庆第一所高职学院，是教育部、财政部重点建设的100所国',10028,'重庆'),(10,447,'哈尔滨学院','哈尔滨学院是一所经国家教育部批准的地方普通本科院校，地处享有“东方巴黎”美誉的冰城──哈尔滨。学校占地面积65万平方米，综合办学条件优良，校区错落分布、疏朗有致，格调',10031,'黑龙江'),(11,732,'黑龙江旅游职业技术学院','黑龙江旅游职业技术学院位于哈尔滨市南岗区学府路315号，是国家教育部备案的黑龙江省唯一一所独立设置的公办经贸旅游类高等职业院校。学院立足黑龙江、牵手商务部、服务商旅',10031,'黑龙江'),(13,1395,'四川工商学院','四川师范大学成都学院，其前身是2001年成立的四川师范大学电子信息工程学院，2004年经教育部批准设立为独立学院，面向全国统一招生，实施全日制本、专科学历教育，培养具有社会责任感、创新精神和实践',10005,'四川'),(14,2570,'贵州师范大学求是学院','学院创办于2001年6月，是国家教育部批准设立的、办学规模超过万人的全日制普通高校，位于拥有“避暑之都”和“森林之城”美誉的贵州省省会城市m',10026,'贵州'),(15,456,'黑龙江东方学院','黑龙江东方学院于1992年创建，是改革开放后由几位离退休教育家创办的黑龙江省第一所民办普通高校。1993年8月，参加全国统一高考招生招收专科生;1995年4月，经原国家教委批准具有专科学历教',10031,'黑龙江'),(16,514,'贵州师范大学','贵州师范大学的前身——“国立贵阳师范学院”创建于1941年，是当时全国八所国立师范学院之一;建校之初，以王克仁、齐泮林、曾景、萧文灿、王佩芬、',10026,'贵州'),(17,1475,'重庆工商大学融智学院','学校概况重庆工商大学融智学院成立于2001年并于当年招生，2003年经教育部批准设立为独立学院。学校位于重庆主城',10028,'重庆'),(19,307,'上海理工大学','上海理工大学是一所以工学为主，理学、管理学、经济学、文学等多学科交融发展的上海市属重点大学，已有百余年办学历史。学校办学文脉源于1906年创办的沪江大学和1907年创办的德',10000,'上海'),(21,318,'上海对外经贸大学','上海对外经贸大学是国家财经类大学之一，主校区坐落于上海历史文化发祥地松江区。学校创办于1960年，57年来学校的发展始终与国家对外开放、对外贸易发展休戚与共，学校秉持“诚信、宽容、博',10000,'上海'),(22,383,'西安培华学院','西安培华学院是2003年经国家教育部批准升格为西部首家、面向全国招生的民办本科普通高等院校。学校前身可追',10029,'陕西'),(24,1185,'西京学院','西京学院是具有研究生教育资格的普通高校，同时也是国家批准的西北地区唯一一个自学考试综合改革试点单位和主考院校。学院占地1391亩，校舍建筑面积605285㎡。现设有研究生部、基础部、工程技术',10029,'陕西'),(25,1500,'重庆信息技术职业学院','重庆信息技术职业学院是经重庆市人民政府批准、教育部公布备案的全日制普通高等院校（教育部国标代码：12755），是国家技',10028,'重庆'),(26,863,'西安思源学院','imgalt=\"\"src=\"http://img.eol.cn/images/ed/gaokao/2014/xasy01.jpg\"style=\"height:240px;width:4',10029,'陕西'),(28,391,'南华大学','南华大学是由工业和信息化部、国家国防科技工业局、中国核工业集团公司、中国核工业建设集团公司与湖南省人民政府共建，具有58年办学历史的综合大学。学校由原隶属中国核工业部的中南工学院、核工业第六',10022,'湖南'),(29,189,'赣南师范大学','赣南师范大学位于江西南部、京九线上享有“南国宋城、客家摇篮、红色故都、生态家园、稀土王国、世界钨都、脐橙之乡”等美誉的赣州市，是一所校园环境优美、文化底蕴深厚、学科门',10015,'江西'),(30,795,'四川工程职业技术学院','四川工程职业技术学院是一所以工为主，装备制造、能源动力与材料、电子信息、土木建筑、交通运输、财经商贸、教育与体育、旅游、文化艺术等多科型协调发展的公办全日制普通高等学校，全日制高职专科面向全',10005,'四川'),(31,1472,'重庆师范大学涉外商贸学院','重庆师范大学涉外商贸学院',10028,'重庆'),(32,165,'江西理工大学','江西理工大学创办于1958年，原名江西冶金学院，1988年更名为南方冶金学院，2004年更名为江西理工大学。学校曾先后隶属于冶金工业部、中国有色金属工业总公司，2013年成为江西省人民政府、',10015,'江西'),(33,52,'北京师范大学','北京师范大学是一所以教师教育、教育科学和文理基础科学为主要特色的著名学府。2002年9月8日，在人民大会堂举行建校100周年庆祝大会。江泽民等党和国家领导同志出席庆祝大会。江泽民同志在会上充分肯定了百年北师大的办学成就，并强调实施科教兴国战略，大力推进教育创新。面向新世纪，北京师范大学确立了建设综合性、有特色、研究型世界知名高水平大学的奋斗目标。100年以前，清末戊戌变法因“需材孔亟”，开启民智，改变中国屡受列强欺凌的状况，在当时中国最高学府和最高教育行政机关的京师大学堂设立了师范馆，成为北京师',10003,'北京'),(34,31,'北京大学','北京大学创于1898年，初名京师大学堂，是第一所国立综合性大学，也是当时中国的最高教育行政机关。辛亥革命后，于1912年改为现名。作为新文化运动的中心和ldqu',10003,'北京'),(35,1217,'北京大学医学部','北京大学医学教育开始于1912年，建校后先后称为国立北京医科专门学校、北京大学医学院、北京医学院、北京医科大学。2000年与北京大学合并成为新的北京大学后，改称北京大学医学部。',10003,'北京'),(36,46,'中国人民大学','中国人民大学是一所以人文社会科学为主，兼有部分理工学科的综合性研究型全国重点大学。学校的前身是1937年诞生于抗日战争烽火中的陕北公学，以及后来的华北联',10003,'北京'),(37,140,'清华大学','清华大学(TsinghuaUniversity)是中国著名高等学府，坐落于北京西北郊风景秀丽的清华园。是中国高层次人才培养和科学技术研究的重要基地之一。清华大学的前身是清',10003,'北京'),(38,38,'北京交通大学','北京交通大学是教育部直属，教育部、中国铁路总公司、北京市人民政府共建的全国重点大学，是国家“211工程”、“985工程优势学科创新平台”项目建',10003,'北京'),(39,30,'北京工业大学','北京工业大学校本部位于北京市朝阳区平乐园100号，东临东四环南路，南抵左安东路，西邻西大望路，北望平乐园小区；另有三地分校区。校园总建设用地面积约63.97公顷。北',10003,'北京'),(40,47,'北京航空航天大学','北京航空航天大学（简称“北航”，原名北京航空学院，1988年更名）创办于1952年10月，由当时清华大学、北洋大学等8所著名大学的航空院系合并而成。学校',10003,'北京'),(4