天津'),(120,858,'天津中德应用技术大学','天津中德应用技术大学是天津市属全日制公办高等院校，是中国与德国、日本、西班牙三国政府在职业教育和培训领域最大的合作项目，是国家示范性优秀建设高职院校，是全国职业教育先进单位。学校坐落在渤海之',10006,'天津'),(121,837,'天津滨海职业学院','天津滨海职业学院是由地方政府主办的一所全日制综合性公办高等院校。具有50多年的办学历史。2000年经天津市人民政府批准，国家教育部备案，转为高等职业学院。天津滨海职业学院坐落',10006,'天津'),(122,842,'天津工程职业技术学院','天津工程职业技术学院坐落于天津市滨海新区，是一所以工科为主的全日制综合性高职学院，前身为天津大学石油分校。学院占地779亩，建筑面积20多万平方米，有在校生8000余人。',10006,'天津'),(123,856,'天津青年职业学院','天津青年职业学院有近60年的办学历史，是经天津市政府批准，国家教育部备案设立的公办全日制高等职业技术学院，属国家普通高等院校系列。学院依托培养优秀青年干部的学府天津市团校而建立。近60年来，学院培',10006,'天津'),(124,838,'天津渤海职业技术学院','天津渤海职业技术学院是天津市人民政府批准，国家教育部备案公办全日制普通高等专科学校，是天津市高职院校首家通过教育部高职高专人才培养工作水平评估的单位，是天津唯一',10006,'天津'),(125,836,'天津电子信息职业技术学院','天津电子信息职业技术学院是全国100所国家示范性高等职业院校之一。2011年初迁入新建的国家级高等职业教育改革实验区-----天津海河教育园。新校区占地面积49.7公顷，总建筑面积20.6万平方米',10006,'天津'),(126,841,'天津机电职业技术学院','天津机电职业技术学院坐落在天津市风光秀丽的子牙河畔，毗邻平津战役纪念馆。是经天津市政府批准国家教育部备案的具有高等学历教育招生资格的全日制国办普通高等院校，是为经济建设与社会发展培养高素质技',10006,'天津'),(127,845,'天津现代职业技术学院','天津现代职业技术学院成立于2001年，是一所经天津市人民政府批准、国家教育部备案，独立设置的公办全日制高职院校，学院设置了应用文科、应用工科及艺术类共34个专业。专业设置以市场需求为导向，学院现',10006,'天津'),(128,840,'天津公安警官职业学院','天津公安警官职业学院是教育部批准的具有高等学历招生资格的专科层次普通高等学校，是天津市唯一的一所公安高校，录属于天津市公安局和天津市教委。学院始建于19',10006,'天津'),(129,54,'河北大学','学校1921年始建于天津，前身是由法国耶稣会士创办的天津工商大学，先后易名为天津工商学院、津沽大学、天津师范学院、天津师范大学，1960年定名为河北大学。1970年迁至国家历史文化名城—',10016,'河北'),(130,602,'河北工程大学','河北工程大学是河北省重点骨干大学，河北省人民政府、水利部共同建设高校，河北省“国家一流大学建设”二层次高校，坐落在中国历史文化名城、中国“成语典故之都r',10016,'河北'),(131,606,'河北地质大学','河北地质大学(原石家庄经济学院)创办于1953年，是原地质部直属五大院校之一，是国土资源部、河北省人民政府共建大学，河北省属重点骨干大学，中国科学院院士李廷栋任学校名誉校长。',10016,'河北'),(132,591,'华北电力大学保定校区','华北电力大学是教育部直属的国家“211工程”重点建设大学、国家“985工程优势学科平台”重点建设大学。学校校部设在北京，分设保定校区。学校现有',10016,'河北'),(133,597,'华北理工大学','华北理工大学，坐落在沿海现代化城市、环渤海经济区工业重镇—唐山市;是一所以工、医为主，理、经、管、文、法、艺多学科协调发展，具有留学生教育、研究生教育、本科教育、继续教育等全方位',10016,'河北'),(134,55,'河北科技大学','河北科技大学是河北省重点建设的多科性骨干大学，坐落在太行山东麓的河北省省会石家庄市，1996年由原河北轻化工学院、河北机电学院、河北省纺织职工大学合并组建而成，2002年河北纺织工业学校并入',10016,'河北'),(135,603,'河北建筑工程学院','河北建筑工程学院是河北省省属全日制建筑类高等本科院校，是教育部批准的具有高等学历教育招生资格的普通高等院校，国务院首被教育部批准为硕士学位授予单位。批批准具有学士学',10016,'河北'),(136,688,'河北水利电力学院','河北工程技术