0010,'山西'),(230,272,'山西师范大学','山西师范大学创建于1958年，坐落于华夏文明的重要发祥地古尧都临汾市，是培养山西省基础教育师资的重要基地。建校近60年来，学校不断上层次、上水平，现已发展成为一所培养体系完备、办学特色鲜明的',10010,'山西'),(231,282,'太原师范学院','太原师范学院是一所以本科师范教育为主、非师范教育和硕士研究生教育协调发展的全日制高等师范院校，1999年3月经国家教育部批准，由山西大学师范学院、太原师范专科学校和山西省教育学院合并组建而成',10010,'山西'),(232,281,'山西大同大学','山西大同大学是2006年经中华人民共和国教育部批准，由原雁北师范学院、大同医学专科学校、大同职业技术学院、山西工业职业技术学院四校合并成立的多科性大学。新成立的山西大同',10010,'山西'),(233,921,'晋中学院','晋中学院的前身为始建于1958年的晋中师范专科学校，2004年5月经国家教育部批准，在原晋中师范高等专科学校、晋中教育学院、晋中职工大学三校合并的基础上建立山西省省属全日制多科性本科院校。学校坐',10010,'山西'),(234,1257,'长治学院','长治学院(ChangZhiUniversity)创办于1958年，是一所综合性全日制普通高等院校，位于中国重要能源、原材料工业基地、国家优秀旅游城市、国家园林城市、国家卫生城市、国家文明城市和',10010,'山西'),(235,920,'运城学院','null',10010,'山西'),(236,280,'忻州师范学院','忻州师范学院成立于1958年,是经国家教育部批准组建的全日制本科普通高等学校，学士学位授予单位，座落在佛教圣地五台山脚下的温泉之乡??山西省忻州市，有北同蒲铁路、京原铁路、大运高速公路经过，',10010,'山西'),(237,275,'山西财经大学','山西财经大学是一所以经济学、管理学为特色和优势学科，经济学、管理学、法学为主干学科，经、管、法、文、理、工、教多学科相互支撑的多科性财经大学。学校始建于1951年，是新中国成立后建校最早的高',10010,'山西'),(238,919,'山西中医药大学','学校概况山西中医学院的前身为1978年创办的山西医学院中医大学班，1989年经原国家教委批准，正式成立',10010,'山西'),(239,1638,'吕梁学院','吕梁高等专科学校创办于1978年，是一所省属普通高等学校。学校坐落于晋西新兴城市吕梁市，北领武当风光，西润黄河秀色，307国道、太柳高速公路和正在建设中的太中银铁路在这里交汇，与省会太原、尧',10010,'山西'),(240,1639,'山西省财政税务专科学校','山西省财政税务专科学校坐落在山西省省会太原市，是一所培养高等财经应用型人才的全日制高等专科学校，是首批国家示范性高等职业院校。学校前身是1963年成立的山西会计学校，1985年在其基础上建立了山',10010,'山西'),(241,1640,'山西警察学院','山西警察学院肇始于1949年成立的山西省公安学院。1981年山西省人民警察学校挂牌成立。1984年公安部管理干部学院山西分院筹建。1991年公安部管理干部学院山西分院和山西省人民警察学校合并',10010,'山西'),(242,1643,'长治职业技术学院','长治职业技术学院于2000年9月由原长治职工大学、晋东南煤矿学校、长治农业学校合并组建而成，属于国务院授权后、经山西省人民政府首批批准、国家教育部备案、由长治市政府举办的地方性高等职业技术学',10010,'山西'),(243,1644,'山西艺术职业学院','山西艺术职业学院是2000年9月21日经山西省人民政府批准，由原山西文化艺术学校、山西省电影学校以及山西省唯一的一所成人艺术类高校山西职工文学院合并组建而成。其前身是始建于1951年的山西文',10010,'山西'),(244,1428,'晋城职业技术学院','晋城职业技术学院是2001年5月经省人民政府批准、国家教育部备案，由原晋城市教育学院、晋城师范学校、晋城市中等专业学校、晋城市文化艺术学校四校合并组建的一所全日制高职院校。秉承“',10010,'山西'),(245,1421,'山西建筑职业技术学院','山西建筑职业技术学院是国家示范性骨干高职院校，也是山西省办学历史最长、规模最大的高职学院之一，前身是成立于1952年的国家级重点中专山西省建筑工程学校，隶属于山西省住房和城乡建设厅，业务上受山西',10010,'山西'),(246,1645,'山西工程职业技术学院','山西工程职业技术学院是国家示范性高等职业技术学院，具有60多年职业教育办学历史，隶属于山西省教育厅。学院位于太原市中心，东邻龙潭公园，西靠汾河景区。60多年来，学院秉承“励学重行',10010,'山西'),(247,1422,'山西交通职业技术学院','山西交通职业技术学院创建于1958年，隶属于山西省交通运输厅，业务上受省教育厅指导，是省内唯一一所高职层次的交通类院校。建校以来，学院为交通运输行业培养了近3万名专业技术人才。近5年就业率连',10010,'山西'),(248,2646,'大同煤炭职业技术学院','[]',10010,'山西'),(249,1647,'山西机电职业技术学院','山西机电职业技术学院创建于1958年，座落在全国十大魅力城市之一的上党古城——长治市，位于长治市高新技术产业开发区，地处太焦铁路及长太、长邯、长晋高速公路之枢纽，位置',10010,'山西'),(250,1571,'山西戏剧职业学院','山西戏剧职业学院是2002年经山西省人民政府批准，由原山西省戏曲学校和山西省戏剧研究所合并组建的一所综合性高等艺术职业学院。学院现有在校生2000余人，开设有戏曲、音乐、舞蹈、话剧影视、美术、文化',10010,'山西'),(251,1648,'山西财贸职业技术学院','山西财贸职业技术学院始建于1978年8月，前身为国家重点中专学校——山西省财贸学校，2002年4月升格为山西财贸职业技术学院，是国家教育部、省政府批准建立的、隶属于山',10010,'山西'),(252,37,'西北大学','西北大学肇始于1902年的陕西大学堂，1912年始称西北大学，1923年8月改称国立西北大学。1937年抗战爆发后，国立北平大学、国立北平师范大学、国立北洋工学院等内迁来陕，组成国立西安临时大学',10029,'陕西'),(253,330,'西安交通大学','西安交通大学是国家教育部直属重点大学，其前身是1896年创建于上海的南洋公学，1921年改称交通大学，1956年国务院决定交通大学内迁西安，1959年定名',10029,'陕西'),(254,107,'西北工业大学','西北工业大学坐落于古都西安，是一所以发展航空、航天、航海工程教育和科学研究为特色的多科性、研究型、开放式大学，隶属于工业和信息化部。是“卓越大学联盟”成员高校之一。',10029,'陕西'),(255,349,'西安理工大学','西安理工大学属中央和陕西省共建、以陕西省管理为主的高校。学校建校于1949年5月1日，前身是北京机械学院和陕西工业大学于1972年合并组建的陕西机械学院，1994年1月经批准更名为西安理工大学。',10029,'陕西'),(256,57,'西安电子科技大学','西安电子科技大学是以信息与电子学科为主，工、理、管、文多学科协调发展的全国重点大学，直属教育部，是国家“优势学科创新平台”项目和“211工程”项目',10029,'陕西'),(257,361,'西安工业大学','历史沿革西安工业大学创建于1955年，前身为西安第二工业学校，是国家“一五”计划156个重点建设项目的军工配套项目之一，具有鲜明的军工特色。',10029,'陕西'),(258,351,'西安建筑科技大学','西安建筑科技大学坐落在历史文化名城西安，南眺驰名中外的唐代大雁塔，北临举世闻名的明代长安城墙。学校总占地4300余亩，校园环境优美，办学氛围浓郁。学校办学历史源远流长，其办学历史最早可追溯到始建',10029,'陕西'),(259,352,'西安科技大学','西安科技大学历史悠久，底蕴深厚。学校办学历史可以追溯到1895年成立的北洋大学工学院采矿冶金科，1938年迁并于西北工学院矿冶系，1957年并入西安交通大学，1958年从西安交通大学分出成立',10029,'陕西'),(260,354,'西安石油大学','西安石油大学是西北地区惟一一所以石油石化为特色的多科性普通高等学校，是陕西省人民政府和国家三大石油公司共建院校、陕西省高水平大学建设院校、中国政府奖学金来华留学生自主招生院校。学',10029,'陕西'),(261,357,'陕西科技大学','陕西科技大学是我国西部地区唯一一所以轻工为特色的多科性大学，是国家“中西部高校基础能力建设工程”建设高校，是“十二五”期间陕西省重点建设的高水',10029,'陕西'),(262,358,'西安工程大学','西安工程大学是我国西部地区唯一以纺织服装为特色的高等学校。其前身为1912年创办的北京高等工业专门学校机织科，其后历经国立北平大学工学院纺织系、西北联合大学纺织系、西北工学院纺织系等发展阶段',10029,'陕西'),(263,36,'长安大学','null',10029,'陕西'),(264,332,'西北农林科技大学','西北农林科技大学地处中华农耕文明发祥地、国家级农业高新技术产业示范区——陕西杨凌，现为教育部直属全国重点大学，国家“985工程“和“',10029,'陕西'),(265,365,'陕西中医药大学','陕西中医学院的前身是1952年创建于西安的西北中医进修学校，1959年升格为陕西中医学院，1961年迁至古都咸阳，是陕西惟一一所培养高级中医药人才的普通高等院校，是1978年中共中央56号文件确',10029,'陕西'),(266,334,'陕西师范大学','陕西师范大学是教育部直属、国家“211工程”重点建设的一所师范大学，是国家培养高等院校、中等学校师资和教育管理干部的重要基地，被誉为',10029,'陕西'),(267,336,'延安大学','延安大学坐落在革命圣地延安，是由毛泽东同志亲自命名、中国共产党创办的第一所综合性大学。1941年，中共中央政治局决定将陕北公学、中国女子大学、泽东青年干部学校合并成立延安',10029,'陕西'),(268,371,'陕西理工大学','陕西理工学院是一所历史悠久、办学特色鲜明的多科性大学。学校坐落在素有“西北小江南”之美誉的中国历史文化名城??汉中市。物华天宝、人杰地灵，深',10029,'陕西'),(269,369,'宝鸡文理学院','宝鸡文理学院位于炎帝故里、周秦文化发祥地陕西省宝鸡市，占地1070亩，是一所以教师教育为主，具有文、史、哲、理、工',10029,'陕西'),(270,366,'咸阳师范学院','咸阳师范学院是一所以教师教育为特色的省属本科院校。学校创建于1978年5月，原名“陕西师范大学咸阳专修科”。1978年12月，经教育部批准，成立“咸阳师范专科',10029,'陕西'),(271,368,'渭南师范学院','渭南师范学院始于1923年中国共产党建立的赤水职业学校，经历了“抗大式”的赤水农业职业学校、20世纪初期的渭南师范学院、渭南师范专科学校和渭南教育学院，到新世纪的渭南师范',10029,'陕西'),(272,373,'西安外国语大学','西安外国语大学是新中国最早建立的4所外语院校之一，是西北地区唯一的一所主要外语语种齐全的普通高校。1951年，经中央人民政府教育部批准，由兰州大学文学院俄文系、西北大学外国语文系俄文组、俄文',10029,'陕西'),(273,376,'西北政法大学','西北政法大学位于世界历史文化名城西安，是一所法学特色鲜明，哲学、经济、管理、文学等多学科相互支撑、协调发展的多科性大学，是全国法律人才培养的重要基地、西北地区法学研究的中心、陕西省人文社会科学研究',10029,'陕西'),(274,378,'西安体育学院','西安体育学院创建于1954年，坐落于古城西安小雁塔西侧，是国家体育总局与陕西省共建院校，是西北地区唯一一所体育高等学府。学院占地696亩，各类在校生80',10029,'陕西'),(275,380,'西安音乐学院','西安音乐学院位于陕西西安南郊，建校于1949年，是中国西北地区惟一一所高等',10029,'陕西'),(276,382,'西安美术学院','西安美术学院位于西安市南郊，校园占地三百多亩，校舍建筑面积十万余平方米，校园环境幽雅，青树参天、绿草茵',10029,'陕西'),(277,2232,'陕西工业职业技术学院','“国家示范性高等职业院校”陕西工业职业技术学院地处历史文化名城',10029,'陕西'),(278,2233,'杨凌职业技术学院','“国家示范性高等职业院校”杨凌职业技术学院',10029,'陕西'),(279,1043,'西安文理学院','西安文理学院是2003年经教育部批准，由西安市政府主办、省市共建、面向全国招生的一所全日制普通本科高校。先后由西安大学、西安师范专科学校、西安教育学院、西安幼儿师范学校和西安师范学校合并而成，办',10029,'陕西'),(280,1090,'榆林学院','榆林学院是一所陕西省省属综合性本科院校.建校40多年来，先后培养出万余名具有较高层次的实用型人才，为区域经济和社会发展做出了突出的贡献。学院位于国家历史文化名城、国家',10029,'陕西'),(281,1262,'商洛学院','商洛学院是陕西省教育厅直属的一所多科性本科学院，其前身是成立于1976年的“陕西师范大学商洛专修科”，1984年经陕西省人民政府批准更名为“商洛师范专科学校”，2006年2月经教育部批准升格',10029,'陕西'),(282,32,'内蒙古大学','【历史沿革】内蒙古大学位于内蒙古自治区首府、历史文化名城呼和浩特市，距北京400余公里，是新中国成立后党和国家在少数民族地区创办的第一所综合大学。学校于1957年高起点创办，时任国务院副总理',10002,'内蒙古'),(283,505,'内蒙古科技大学','历史沿革建国初期为了发展钢铁工业，1954年国家在包头兴建钢铁基地—包头钢铁公司。这颗“草原明珠”的诞生，急需大批工程技术人才。',10002,'内蒙古'),(284,508,'内蒙古工业大学','内蒙古工业大学坐落在内蒙古自治区呼和浩特市，前身是始建于1951年的绥远省高级工业学校。1958年在清华大学支援下成立内蒙古工学院，曾隶属机械工业部、农业机械部，1983年划归内蒙古自治区，',10002,'内蒙古'),(285,517,'内蒙古农业大学','内蒙古农业大学是自治区重点大学，是国家首批32个大学生文化素质教育基地之一。2001年学校成为国家西部大开发“一省一校”重点支持建设院校，2012年成为自治区人民政府',10002,'内蒙古'),(286,519,'内蒙古师范大学','内蒙古师范大学创建于1952年，是新中国成立后党和国家在边疆少数民族地区最早建立的高等学校，自治区重点大学，是具有鲜明教师教育和民族教育特色的综合性师范大学。经过几代人的艰苦创业、实践探索，',10002,'内蒙古'),(287,506,'内蒙古民族大学','内蒙古民族大学始建于1958年，2000年由原内蒙古民族师范学院、内蒙古蒙医学院、哲里木畜牧学院合并组建而成，是内蒙古自治区重点建设高校，也是内蒙古自治区人民政府和国家民委共建高校。',10002,'内蒙古'),(288,1042,'赤峰学院','赤峰学院是2003年经国家教育部批准，由具有40多年办学历史、在社会上享有良好声誉的赤峰民族师范高等专科学校与赤峰教育学院、内蒙古广播电视大学赤峰分校、赤峰卫生学校、内蒙古幼儿师范学校合并组',10002,'内蒙古'),(289,1242,'呼伦贝尔学院','呼伦贝尔学院位于内蒙古自治区东部，坐落在被誉为中国最美的草原、全国最佳民族风情魅力城市的呼伦贝尔市，是一所立足呼伦贝尔，服务内蒙古，面向全国的全日制综合性普通高等学校，是呼伦贝尔市唯一一所本',10002,'内蒙古'),(290,1574,'内蒙古建筑职业技术学院','内蒙古建筑职业技术学院是一所具有61年办学历史的建筑类高职名校，是内蒙古自治区唯一一所独立设置的建筑类高等院校。学院前身是成立于1956年的内蒙古建筑学校，1958年改制为内蒙古建筑学院，举',10002,'内蒙古'),(291,1550,'集宁师范学院','集宁师范学院是一所具有深厚历史渊源和文化底蕴的学校。1931年，原绥远省在集宁创办绥远省立第二师范学校，开启了乌兰察布近现代师范教育的先河。1958年，依托之前设置的集宁师范学校，集宁师范专',10002,'内蒙古'),(292,1637,'内蒙古丰州职业学院','内蒙古丰州职业学院青城学院(原内蒙古青城大学)是1983年经自治区政府批准、国家教育部备案由民盟内蒙古区委创办，学院代码11429，报考代码778，是内蒙古自治区成立最早的高等职业学院。学院',10002,'内蒙古'),(293,1624,'河套学院','河套学院是一所立足西部，面向全区，培养高素质应用型专门人才的多科性大学。学院设有12个教学系部，全日制本专科在校生10064人，其中本科层次在校生4054人。专任教',10002,'内蒙古'),(294,2316,'呼和浩特民族学院','呼和浩特民族学院是由国家教育部批准，内蒙古自治区人民政府主办的普通本科高等学校，主要面向内蒙古和蒙古语文协作八省区、辐射全国招生。她的前身是原内蒙古民族高等专科学校，始建于1953年。学校一',10002,'内蒙古'),(295,1525,'包头职业技术学院','包头职业技术学院坐落于享有“塞外明珠”“草原钢城”美誉的全国首批文明城市——包头，现隶属于包头市人民政府，是国家百所示',10002,'内蒙古'),(296,1625,'兴安职业技术学院','兴安职业技术学院坐落在大兴安岭南麓素有“内蒙古延安”美称的乌兰浩特市。是2001年经内蒙古自治区人民政府批准的全区首批独立设置的高职院校，自治区示范院校。学院现占地面',10002,'内蒙古'),(297,1626,'呼和浩特职业学院','呼和浩特职业学院是经内蒙古自治区人民政府批准成立的一所全日制普通高等院校，也是呼和浩特市政府所属唯一一所高等院校。学院的办学历史可追溯到1907年的归绥学堂，迄今已有百余年，其中职业教育办学',10002,'内蒙古'),(298,1627,'包头轻工职业技术学院','包头轻工职业技术学院是内蒙古自治区唯一全日制轻工类高等职业院校，始建于1956年，隶属包头市政府，学校位于“草原钢城”包头市中心城区，呼包鄂金三角交汇处，毗邻包茂、京',10002,'内蒙古'),(299,1163,'内蒙古电子信息职业技术学院','学院代码783学院概况内蒙古电子信息职业技术',10002,'内蒙古'),(300,1394,'内蒙古机电职业技术学院','内蒙古机电职业技术学院成立于2003年，是经自治区人民政府批准、国家教育部备案的培养理工科技术技能人才的公办全日制普通高等学校，直属自治区教育厅。学院是国家百所骨干高职院校。学院占地面积83',10002,'内蒙古'),(301,1132,'内蒙古化工职业学院','内蒙古化工职业学院是内蒙古自治区教育厅直属的一所具有鲜明化工和建材行业特色及技术优势的国办全日制高等职业院校，是国家骨干高等职业院校，先后荣获“全国职业教育先进单位”',10002,'内蒙古'),(302,1164,'内蒙古商贸职业学院','内蒙古商贸职业学院创建于1952年，是教育部批准独立设置，隶属于自治区教育厅的一所学科类别齐全、面向区内外招生的公办全日制普通高等职业院校，是自治区示范性高职院校建设单位、全国100所现代学',10002,'内蒙古'),(303,1628,'锡林郭勒职业学院','锡林郭勒职业学院是内蒙古政府批准、教育部备案的综合类高职院校，成立于2003年5月，先后由锡林郭勒盟教育学院、师范学校、蒙古族师范学校、广播电视大学、民族卫生学校、民族财贸学校、民族体育学校',10002,'内蒙古'),(304,1629,'内蒙古警察职业学院','null',10002,'内蒙古'),(305,1545,'内蒙古体育职业学院','内蒙古体育职业学院隶属于自治区体育局，其前身为始建于1965年的内蒙古体育运动学校，2001年6月，经自治区人民政府批准组建成立，是自治区唯一的体育高等院校。学院办学形式为全日制高等职业教育',10002,'内蒙古'),(306,1524,'乌兰察布职业学院','一、学院简介乌兰察布职业学院是经自治区人民政府批准、国家教育部正式备案成立的公办全日制综合类普通高等职业院校。现有全日制在校生近6800人。',10002,'内蒙古'),(307,861,'通辽职业学院','通辽职业学院是一所公办全日制普通高等院校。学院于2009年10月顺利通过国家高等职业院校人才培养工作评估。2015年被评为《自治区示范性高职院校》。学院坐落于通辽经',10002,'内蒙古'),(308,1630,'科尔沁艺术职业学院','科尔沁艺术职业学院是经内蒙古自治区人民政府批准，教育部备案，以原通辽市艺术学校为基础组建的艺术类高等职业学校，以举办专科层次高等职业教育为主，兼顾中等职业教育职能。',10002,'内蒙古'),(309,1153,'内蒙古交通职业技术学院','内蒙古交通职业技术学院是一所公办全日制高等职业院校。经过多年发展建设，学院综合办学实力稳步增强，人才培养水平逐年提升，现在是全国交通类职业教育示范院校、国',10002,'内蒙古'),(310,1631,'包头钢铁职业技术学院','包头钢铁职业技术学院位于包头市中心，2005年由国有特大型企业—包钢(集团)公司出资，经内蒙古自治区人民政府批准，国家教育部备案，成立的一所公办全日制普通高等院校。',10002,'内蒙古'),(311,1632,'乌海职业技术学院','乌海职业技术学院创办于2004年，是经内蒙古自治区人民政府批准成立、国家教育部备案的全日制公办普通高等职业院校，受内蒙古自治区教育厅和乌海市人民政府双重领导。学院与内蒙古工业大学乌海学院是一个实',10002,'内蒙古'),(312,50,'辽宁大学','经过半个多世纪的不懈努力，辽宁大学已经成为一所具备文、史、哲、经、法、理、工、管、艺等多学科的辽宁省惟一的综合性大学。学校现有三个校区，即沈阳崇山校区、沈阳蒲河校区和辽阳武圣校区，教学区占地面积',10027,'辽宁'),(313,138,'大连理工大学','大连理工大学1949年4月建校，时为大连大学工学院；1950年7月大连大学建制撤销，大连大学工学院独立为大连工学院；1960年被确定为教育部直属全国重点',10027,'辽宁'),(314,3122,'大连理工大学盘锦校区','null',10027,'辽宁'),(315,227,'沈阳工业大学','沈阳工业大学坐落在中国东北地区现代化的中心城市沈阳市，是一所以工为主，涵盖工、理、经、管、文、法、哲、艺术等八大学科门类的多科性教学研究型大学。学校始建于1949年，1985年由沈阳机电学院更名',10027,'辽宁'),(316,209,'沈阳航空航天大学','沈阳航空航天大学是一所以航空宇航为特色，以工为主，工、理、文、经、管等学科协调发展的多科性高等院校，是教育部、中航工业集团公司与辽宁省三方共建高校，是国防科工局与辽宁省共建高校，是空军依托培',10027,'辽宁'),(317,217,'沈阳理工大学','沈阳理工大学始建于1948年，前身是东北军工专门学校。1960年组建成立了沈阳工业学院，隶属国家兵器工业部，时任国家副主席的董必武同志为学校题写了校名。1999年学校划归辽宁省管理，实行省部',10027,'辽宁'),(318,134,'东北大学','null',10027,'辽宁'),(319,222,'辽宁科技大学','辽宁科技大学是一所面向全国招生，以工学为主，涵盖工学、理学、经济学、管理学、文学、法学、艺术学等七大学科门类的多科性大学。地处祖国钢都、国家卫生城、中国优秀旅游城市—辽宁省鞍山市。校',10027,'辽宁'),(320,786,'辽宁工程技术大学','奋进中的辽宁工程技术大学辽宁工程技术大学建于1949年，是一所以工为主，以工程技术见长的国家重点大学。1978年被国务院确定为全国88所重点大学之一，1996年经国',10027,'辽宁'),(321,223,'辽宁石油化工大学','辽宁石油化工大学1950年始建于大连，是新中国第一所石油工业学校，1953年迁至抚顺办学，1958年升格为抚顺石油学院，2000年2月由中央部委划转为辽',10027,'辽宁'),(322,215,'沈阳化工大学','沈阳化工学院位于历史文化名城沈阳市的西南，地处国家级沈阳经济技术开发区的腹地，紧邻装备制造业核心区和化学工业区。学校为国家首批学士学位授予权单位，1993年被国务',10027,'辽宁'),(323,220,'大连交通大学','大连交通大学创建于1956年，时为大连机车车辆制造学校；1958年升格为大连铁道学院，隶属原铁道部管理；2000年2月划转为辽宁省政府管理，实施“中央与地方共建，以地方管理为主rd',10027,'辽宁'),(324,33,'大连海事大学','大连海事大学(原大连海运学院)是交通运输部所属的全国重点大学，是中国著名的高等航海学府，是被国际海事组织认定的世界上少数几所“享有国际盛誉”的海事院校之一。',10027,'辽宁'),(325,211,'大连工业大学','大连工业大学创建于1958年，前身是沈阳轻工业学院，1970年迁至大连，改称为大连轻工业学院。学校原隶属国家轻工业部，1998年转制为中央与地方共建、辽宁省为主的管理体制。2007年经教育部',10027,'辽宁'),(326,212,'沈阳建筑大学','沈阳建筑大学是以建筑、土木、机械等学科为特色，以工为主，工、管、理、文、农、法、艺术等学科门类协调发展的省部共建高等学校，原隶属于国家建设部，2000年在国家办学管理体制调整中划归辽宁省管理。',10027,'辽宁'),(327,213,'辽宁工业大学','null',10027,'辽宁'),(328,228,'沈阳农业大学','沈阳农业大学是一所地方与中央共建的全国重点大学。现任党委书记迟维意，校长刘广林。学校坐落在沈阳市东郊的天柱山南麓，东与世界文化遗产清福陵毗邻，西与沈阳城区相连，占地',10027,'辽宁'),(329,210,'大连海洋大学','divsty',10027,'辽宁'),(330,230,'中国医科大学','中国医科大学是中国共产党最早创建的院校，是唯一以学校名义走完红军两万五千里长征全程并在长征中继续办学的院校，是我国最早进行西医学学院式教育的医学高校之一。其前身为中国工农红军军医学校和中国工农红',10027,'辽宁'),(331,207,'锦州医科大学','锦州医科大学诞生于解放战争时期，学校前身为1946年在吉林省洮南市成立的辽吉军区卫生学校。1949年迁址辽宁省锦州市，1958年成立锦州医学院，2006年更名为辽宁医学院。2007年以优秀的',10027,'辽宁'),(332,219,'大连医科大学','大连医科大学创建于1947年，原校名为关东医学院。1950年更名为大连医学院，1969年举校南迁贵州省遵义市，1978年学校在大连医学院原址',10027,'辽宁'),(333,205,'辽宁中医药大学','辽宁中医药大学成立于1958年，主校区位于沈阳，分校区位于大连和本溪，是辽宁省唯一一所培养中医、中药、针灸推拿、中西医临床医学、高级护理和医学相关类人才的高等院校。学校先后获得全国创先争优先',10027,'辽宁'),(334,226,'沈阳药科大学','沈阳药科大学是一所具有光荣革命传统的学校，1931年诞生于江西瑞金，是我国历史最悠久的综合性药科大学。学校占地面积141.8万平方米，建筑面积57万平方米。学校目前',10027,'辽宁'),(335,202,'沈阳医学院','沈阳医学院简介沈阳医学院始建于1949年，是教育部批准的全日制普通高等医学院校',10027,'辽宁'),(336,225,'辽宁师范大学','辽宁师范大学是一所省属重点大学，坐落在中国北方美丽的海滨城市——大连，是辽宁省基础教育师资培养与继续教育基地、教育科学研究咨询基地、高校师资培训基地、适应地区经济建设',10027,'辽宁'),(337,221,'沈阳师范大学','沈阳师范大学隶属于辽宁省人民政府，是一所涵盖哲学、经济学、法学、教育学、文学、理学、工学、管理学、艺术学等九大门类的多科性大学。学校始建于1951年，其前身为东北教育学院。1',10027,'辽宁'),(338,214,'渤海大学','渤海大学是一所省属综合性大学，坐落于渤海之滨的美丽城市—锦州。学校南临秀美的女儿河，与巍巍南山隔水相望。校园建筑欧式风格浓郁，湖光山色，灵动清雅。',10027,'辽宁'),(339,204,'鞍山师范学院','鞍山师范学院是一所本科层次的全日制普通高等师范学校，位于辽宁省鞍山市，东倚风景秀丽、文化底蕴独特的千山风景区，西北望气势宏伟的四十里钢城。学校始建于1958年，196',10027,'辽宁'),(340,1671,'朝阳师范高等专科学校','朝阳师专新校区坐落在风景秀丽的朝阳市龙山，其前身是1960年由辽宁省人民政府批准建立的朝阳市师范专科学校，1962年至1977年调整停办，1977年由辽宁省教育局批准成立辽宁省第一师范学院朝',10027,'辽宁'),(341,229,'东北财经大学','东北财经大学地处国家级风景区——大连市星海公园西侧。整个校园由主、辅两个校区构成，总占地923.05亩。截至2013年9月，学校有全日制',10027,'辽宁'),(342,122,'吉林大学','吉林大学坐落在吉林省省会长春市，是教育部直属的一所全国重点综合性大学，1995年首批通过国家教委“211工程”审批，2001年被列入“985工程rdqu',10004,'吉林'),(343,129,'延边大学','延边大学成立于1949年4月，是一所具有鲜明民族特色的地方综合性大学。1957年9月前曾隶属于国务院高教部，之后划归吉林省所属。建校初期，学校设有文学部',10004,'吉林'),(344,379,'长春理工大学','长春理工大学是一所以光电技术为特色，光、机、电、算、材相结合为优势，以工为主，工、理、文、经、管、法、艺多学科协调发展的教学研究型大学。学校是吉林省、国家国防科技工业局、长春市共建院校，l',10004,'吉林'),(345,393,'东北电力大学','东北电力大学是吉林省重点大学，坐落在依山傍水、景色宜人的著名旅游城市--吉林省吉林市，是一所以工科为主，理、工、文、管、法、经、教育等学科门类协调发展的多科性大学。在长期办学过程中，学校坚持',10004,'吉林'),(346,381,'长春工业大学','长春工业大学是一所以工为主，工、管、文、理、经、法、教育、艺术等多学科相互支撑、协调发展的省属重点大学，是吉林省高层次人才培养、应用技术研发、高新技术产品研制、高水平社会服务的重要基地。19',10004,'吉林'),(347,400,'吉林化工学院','吉林化工学院（原隶属化工部）成立于1958年，是吉林省唯一一所化工类大学，经过几代化院人的探索实践，积淀了深厚的文化底蕴，形成了“校企合作，育人成才”鲜明的办学特色。',10004,'吉林'),(348,384,'吉林农业大学','吉林农业大学创建于1948年，是吉林省属重点大学，是我国首批具有学士、硕士学位授予权的高等院校之一，1993年，成为吉林省省属院校中最早获得博士学位授权单位的高校，2011年，成为吉林省人民',10004,'吉林'),(349,404,'长春中医药大学','长春中医药大学前身为1958年成立的长春中医学院，2006年更名长春中医药大学。历经五十余年的辛勤耕耘、孜孜以求和创新发展，学校形成了“启古纳今，厚德精术”的校训，形',10004,'吉林'),(350,142,'东北师范大学','著名的高等学府东北师范大学是教育部直属高校，国家“211工程”重点建设大学。学校坐落在美丽的北国春城长春市。本部校区地处人民大街中段，净月校区设在风景如画的净月潭旅游开发',10004,'吉林'),(351,374,'北华大学','北华大学是吉林省省属规模最大的重点综合性大学，1999年经教育部批准，由原吉林师范学院、吉林医学院、吉林林学院、吉林电气化高等专科学校合并组建而成。学校坐落在风景迷人的雾凇之都、中国魅力城市',10004,'吉林'),(352,408,'通化师范学院','通化师范学院坐落于长白山脚下、鸭绿江畔、中朝边境的吉林省通化市。学院风景秀丽、群山环抱，形成了以长白山的自然、粗犷为主基调，以长白山园林景树、植物为主要景点的长白山园林式校园。',10004,'吉林'),(353,390,'吉林师范大学','吉林师范大学是吉林省重点大学，坐落在吉林省四平市。学校建于1958年。现任党委书记卓越教授，现任校长张伯军教授。吉林师范大学是吉林省高中骨干教师培养中心。建校50年来，',10004,'吉林'),(354,405,'吉林工程技术师范学院','吉林工程技术师范学院坐落在风光秀美的历史名城吉林省省会长春市，是国务院批准成立的全国第一所专门为职业教育培养培训专业课师资的全日制本科师范院校，也是目前东北三省和内蒙古地区唯一一所独立设置的',10004,'吉林'),(355,410,'白城师范学院','白城师范学院坐落在素有鹤乡之称的白城市，是吉林省西部唯一的一所本科院校。始建于1958年。2000年8月，吉林省政府决定将白城林业学校并入白城师范高等专科学校；2002年3月经教育部批准',10004,'吉林'),(356,412,'吉林财经大学','吉林财经大学是吉林省重点大学，是吉林省人民政府与国家税务总局共同建设的学校。学校起步于1946年7月东北银行总行举办的银行干部训练班，经历了东北银行干部学校、东北银',10004,'吉林'),(357,413,'吉林体育学院','吉林体育学院始建于1958年,学院是集“教育、竞技、科研、企业”四位一体的新型体育院校，经几代人上下求索，逐日昌盛，为国家育世界冠军百余人。近年来，学院党委带领全院师',10004,'吉林'),(358,1291,'吉林艺术学院','吉林艺术学院是东北地区惟一的综合性高等艺术学府。她诞生于硝烟战乱之时，成长于民族复兴之际，在历史的行进中，深深植根于东北这片广袤大地之上，浸染着白山黑水的精魂，铸就了博大开放、生生不息的传统',10004,'吉林'),(359,1609,'辽源职业技术学院','辽源职业技术学院是1999年7月26日由国家教育部批准成立的一所公立的、专科层次的普通高等学校。学院的前身建于1958年，前后经历了辽源矿业学院、辽源矿业专科学校、辽源煤炭工业学校和吉林工业',10004,'吉林'),(360,411,'吉林华桥外国语学院','吉林华桥外国语学院是吉林省重点高校。学校创办于1995年;2003年被教育部批准为民办普通高等本科院校;2005年获得学士学位授予权并开始联合招收硕士研究生;2007年成为全国民办高校中第一',10004,'吉林'),(361,1610,'四平职业大学','四平职业大学（吉林师范大学应用工程学院）地处四平市风光秀丽、景色宜人的山门风景区，始建于1983年，是一所以培养应用型人才为主，工、管、文、理等多学科协调发展的全日制公办普通高等职业专科院校',10004,'吉林'),(362,1604,'吉林工商学院','吉林工商学院是2007年3月经国家教育部批准，由原吉林财税高等专科学校、吉林商业高等专科学校和吉林粮食高等专科学校实体合并组建的省属公办本科院校。原三所学校均成立于上世纪50年代，在半个多世',10004,'吉林'),(363,1546,'长春汽车工业高等专科学校','“国家示范性高等职业院校”长春汽车工业高等专科学校始建于1978年，是经',10004,'吉林'),(364,394,'长春工程学院','长春工程学院是2000年由三所具有50年办学历史的全国示范性高等工程专科重点建设学校（原长春建筑高等专科学校、长春工业高等专科学校、长春水利电力高等专科学校）合并组建的一所以工为主，工、管、',10004,'吉林'),(365,1014,'吉林农业科技学院','吉林农业科技学院是一所以培养应用型人才为主的省属公办全日制本科院校，学院分南北两个校区：南校区位于吉林经济技术开发区，北校区坐落在吉林省左家自然保护区。学校现设有动物科',10004,'吉林'),(366,1605,'长春金融高等专科学校','长春金融高等专科学校是中国人民银行创办的、吉林省唯一的中央与地方共建金融院校。学校集金融人才培养、金融行业培训、金融科技创新、金融文化传承与创新为一体，是吉林省重要的金融教育产业服务基地，金',10004,'吉林'),(367,1606,'吉林警察学院','吉林警察学院是一所以培养具有较高政治素质、扎实理论基础、较强创新能力和实战技能的应用型公安人才和经济建设适用人才的具有鲜明特色的全日制本科院校。吉林警察学院办学历史悠久，其',10004,'吉林'),(368,377,'长春大学','长春大学坐落在吉林省长春市，是一所省属全日制综合性大学。现有三个校区，总占地面积103万平方米。学校前身是1949年由原东北人民政府工业部创办的长春工业会计统计专门学校。后历经多次易名于19',10004,'吉林'),(369,1607,'长春医学高等专科学校','长春医学高等专科学校座落在吉林省长春市经济技术开发区内，始建于1936年，是经教育部批准的全日制普通高等专科学校。73年的历史积淀