占地0.39平方公里，广州东校区占地1.13平方公里，珠',10011,'广东'),(685,106,'暨南大学','暨南大学是中国第一所由国家创办的华侨学府，是目前全国境外生最多的大学，是国家“211工程”重点综合性大学，直属国务院侨务办公室领导。“暨南”二字出',10011,'广东'),(686,283,'汕头大学','汕头大学是1981年经国务院批准成立的广东省属“211工程”重点建设综合性大学，是教育部、广东省、李嘉诚基金会三方共建的高等院校，也是全球唯一一所由私人基金会mda',10011,'广东'),(687,105,'华南理工大学','华南理工大学是直属教育部的全国重点大学，坐落在南方名城广州，占地面积294多万平方米。校园分为两个校区，五山校区位于广州市天河区石牌高校区，校园内湖光山色、绿树繁花，民族式建筑与现代化楼群错',10011,'广东'),(688,287,'华南农业大学','华南农业大学是全国重点大学，是广东省和农业部共建的“211工程”大学;2015年6月，学校入选广东省高水平大学重点建设高校。校园坐落在素有“花城rdqu',10011,'广东'),(689,288,'广东海洋大学','广东海洋大学是广东省人民政府和国家海洋局共建的省属重点建设大学，是一所以海洋和水产为特色、多学科协调发展的综合性大学，是教育部本科教学水平评估优秀院校，是具有“学士、硕士、博士',10011,'广东'),(690,294,'广东医科大学','广东医科大学的前身是中山医学院湛江分院，创建于1958年，1964年升格为五年制医学本科院校并更名为湛江医学院，1992年易名为广东医学院，2016年更名为广东医科大学。1960年被评为全国',10011,'广东'),(691,289,'广州中医药大学','广州中医药大学创办于1956年，是新中国首批建立的四所中医药高等学校之一，先后直属国家卫生部、国家中医药管理局领导，2000年转由广东省人民政府管理，现为广东省“211工程rd',10011,'广东'),(692,296,'广东药科大学','广东药科大学是华南地区最早开办现代药学教育，最早设置药学本科专业的公办普通高等院校，其前身是始建于1958年的广东省卫生干部进修学院。经过58年的建设发展，目前学校成为全国三所药科大学之一，',10011,'广东'),(693,98,'华南师范大学','华南师范大学始建于1933年，前身是广东省立勷勤大学师范学院。1996年进入国家“211工程”重点建设大学行列，2015年成为广东省人民政府和教育部共建高校，同年进',10011,'广东'),(694,298,'韶关学院','韶关学院是广东省人民政府主管的省市共建地方本科院校。在48年的办学历程中，学校为社会培养输送了各类人才7.5万余人。学校的前身是创办于1958年的韶关师范专科学校。19',10011,'广东'),(695,300,'惠州学院','惠州学院位于全国文明城市、广东省历史文化名城--惠州，南临南海大亚湾，毗邻广州、东莞、深圳、香港，是广东省省属公办综合性本科大学。学院办学历史悠久，人文荟萃，校园青山环抱，浓荫匝地，现代建筑',10011,'广东'),(696,297,'韩山师范学院','韩山师范学院是一所办学历史悠久、文化积淀深厚和办学特色鲜明的广东省属本科师范院校，位于国家历史文化名城潮州市。潮州是广东的东大门，地处汕头、深圳、厦门三大经济特区的中心位置，是珠江三角地区和',10011,'广东'),(697,299,'岭南师范学院','岭南师范学院(原湛江师范学院)是一所具有百年师范教育历史的广东省属普通本科院校，坐落在中国大陆最南端的美丽港城湛江市。学校1904年始设师范科教育，1978年更名为雷州师范专科学校，1991',10011,'广东'),(698,961,'肇庆学院','肇庆学院为公办全日制综合性本科大学，创办于1970年。学校地处珠三角核心区广东省肇庆市端州区，坐落于国家级重点风景名胜星湖景区内，校园总占地面积1214.3亩，环境',10011,'广东'),(699,301,'嘉应学院','嘉应学院是一所省属普通本科院校，有着94年的办学历史。学院位于中国历史文化名城，客家人的聚居地，著名的文化之乡、华侨之乡、足球之乡-广东省梅州市。梅州在清朝时称嘉应州，嘉应学院由此得名。/',10011,'广东'),(700,303,'广州体育学院','广州体育学院地处广州市繁华的天河区商贸圈中心,南倚体育中心，东邻广州新八景“天河飘绢”，西傍东风公园，北靠天河火车东站，校园绿树成荫，花香流溢，是全国体院中享有独特地缘优势的多学科体育学院。',10011,'广东'),(701,304,'广州美术学院','广州美术学院是广东省所属的一所美术与设计系科设置齐全的高等美术学府，始建于1953年秋，其前身是中南美术专科学校，由华南文艺学院、中南文艺学院和广西艺专的美术专业调整合并而成，原址在湖北武昌',10011,'广东'),(702,305,'星海音乐学院','星海音乐学院地处岭南文化中心－－广州，是我国华南地区唯一的一所高等音乐专业学府。其办学历史可追溯到1932年由中国现代音乐教育先驱马思聪、陈洪先生创办的专业音乐学校－－“广州音乐院”。学',10011,'广东'),(703,964,'广东技术师范学院','广东技术师范学院是一所具有硕士学位授予权的省属全日制普通本科院校，隶属于广东省教育厅。学院前身为广东民族学院，创办于1957年，1977年开始招收本科生，1998年经广东省人民政府同意并报国',10011,'广东'),(704,284,'深圳大学','1980年，中国创办深圳经济特区；1983年，深圳经济特区创办深圳大学。学校坐落南山半岛，面临后海，遥对香港。占地1.44平方公里。深圳市委、市政',10011,'广东'),(705,966,'广东白云学院','广东白云学院',10011,'广东'),(706,974,'顺德职业技术学院','顺德职业技术学院是国家骨干高等职业院校、广东省示范性高等职业院校、广东省一流高职院校建设单位，坐落在珠三角腹地佛山顺德，占地面积117公顷(1749亩)。学校先后获得“全国职业教',10011,'广东'),(707,2048,'广东轻工职业技术学院','广东轻工职业技术学院是1999年经教育部批准成立的全日制高等职业技术学校，由广东省人民政府主办、广东省教育厅直接管理。前身是创建于1933年的“广东省立第一职业学校”',10011,'广东'),(708,617,'广东交通职业技术学院','省级精品资源共享课17门、省级精品在线开放课程4门;拥有137个设备先进的一体化多功能校内实训教学场所，39个政校企共建校内实训基地和培训基地，470家紧密型校外顶岗实习基地，其中中央财政支',10011,'广东'),(709,620,'广东水利电力职业技术学院','广东水利电力职业技术学院创建于1952年，是广东省唯一以水利电力类专业为主的公办全日制高等职业院校。2015年，学院被中央文明委评为第四届全国文明单位。学院是国家(',10011,'广东'),(710,975,'潮汕职业技术学院','潮汕职业技术学院是1999年经国家教育部批准设立的普通高校。学院位于粤东潮汕平原普宁市区，普宁市是闻名全国的商贸名城，“中国纺织服装之都”，地理位置优越，比邻粤东名城',10011,'广东'),(711,293,'广州大学','广州大学是经教育部批准，于2000年由广州师范学院、华南建设学院（西院）、原广州大学和广州高等师范专科学校等高校合并组建而成的综合性大学，实行广东省与广州市共建、以市为主的管理体制。学校于1',10011,'广东'),(712,963,'广东警官学院','广东警官学院的前身是建立于1949年11月的广东省公安干部学校，五十多年来，学院经历了政法干部培训，政法中专、大专，公安专科、本科教育的历程，目前是华南地区第一所也是唯一的公安本科院校。',10011,'广东'),(713,646,'深圳职业技术学院','“国家示范性高等职业院校”深圳职业',10011,'广东'),(714,96,'广西大学','广西大学是一所历史悠久的地方综合性大学，创办于1928年，首任校长是我国著名教育家、科学家马君武博士。1997年，广西大学与广西农学院合并组建新广西大学。现设哲学、经济学、法学、文学、理学、',10012,'广西'),(715,532,'桂林电子科技大学','桂林电子科技大学座落在世界著名的风景游览城市和中国历史文化名城——广西壮族自治区桂林市，是工业和信息化部与广西壮族自治区共建高校、国家“中西部高校基础能力',10012,'广西'),(716,533,'桂林理工大学','1956年，正值年轻的共和国大规模开展工业化建设的火红年代，为满足祖国建设需要，国家重工业部决定在广西组建桂林地质学校。同年11月，桂林理工大学这颗植根于八桂沃土的庄严生命宣告诞生。',10012,'广西'),(717,530,'广西医科大学','广西医科大学位于广西壮族自治区首府南宁市风景秀丽的南湖之滨，占地面积857.47亩，创建于1934年，是全国建校较早的医学院校之一。nbs',10012,'广西'),(718,1033,'右江民族医学院','右江民族医学院是一所广西壮族自治区区（省）属全日制普通高等医科院校，座落在广西西部的重镇—百色市。这里是1929年邓小平同志领导著名的百色起义、创建中国工农红军第七军和右江革命根',10012,'广西'),(719,538,'桂林医学院','桂林医学院是广西壮族自治区直属普通本科院校，创建于1935年，拥有硕士学位授予权。2006年11月26日至12月1日，我校接受了教育部本科教学工作水平评估。根据专家组的考察评估意见和教育部普',10012,'广西'),(720,531,'广西师范大学','广西师范大学是广西壮族自治区重点大学，坐落在世界著名山水旅游名城、历史文化名城桂林市。学校有王城、育才、雁山3个校区，校园面积3114.9亩。现有在职教职员工2180多人，全日制本科生146',10012,'广西'),(721,541,'广西师范学院','广西师范学院成立于1953年，位于广西壮族自治区首府南宁市，是国家中西部高校基础能力建设工程(二期)项目学校，教育部数据中国“百校工程”项目试点学校，教育部直属综合性',10012,'广西'),(722,2364,'广西民族师范学院','广西民族师范学院坐落在中国通往东南亚门户城市、桂西南区域交通枢纽城市、具有悠久历史和光荣革命传统的广西壮族自治区崇左市，是桂西南地区唯一一所公办全日制普通本科院校，被誉为“边陲明',10012,'广西'),(723,1035,'河池学院','河池学院是经国家教育部批准成立的全日制普通本科院校，实行广西壮族自治区与河池市共建、以自治区为主的办学体制，是自治区全额拨款事业单位。学院坐落在山青水秀、交通便捷的历史文化名城、中国优秀旅游',10012,'广西'),(724,539,'玉林师范学院','玉林师范学院坚持立足玉林、面向广西、服务基层的办学宗旨，逐步形成了自身的办学传统和鲜明的办学特色，为民族地区教育文化事业和经济的发展提供了强有力的人才和智力支持。玉林师',10012,'广西'),(725,1374,'广西艺术学院','广西艺术学院位于广西壮族自治区首府南宁市，是全国7所综合性普通本科高等艺术院校之一，2012年成为中华人民共和国文化部与广西壮族自治区人民政府共建的高校。学校成立于',10012,'广西'),(726,543,'广西民族大学','学校创办于1952年3月，原为中央民族学院（今中央民族大学）广西分院，1953年改称广西省民族学院，1958年更名为广西民族学院，2006年2月4日教育部批准更名为广西民族大学。是国家',10012,'广西'),(727,1252,'百色学院','百色学院是经教育部批准成立的一所全日制普通本科院校，坐落在广西百色市城区中心。现有在职教职工487人，专任教师295人。其中，正高职称17人，副高97人，博士、硕士及研究生学历94人，曾到国',10012,'广西'),(728,1735,'广西机电职业技术学院','“国家示范性高等职业院校建设计划”骨干高职院校广西机电职业技术学院的前身',10012,'广西'),(729,1728,'广西体育高等专科学校','广西体育高等专科学校成立于1956年6月，是自治区人民政府主办，自治区体育局和教育厅共同管理的普通高等学校。现设有体育与教育系、运动系、运动医学系、体育产业与传媒系、土木建筑工程系、公共课教',10012,'广西'),(730,1251,'梧州学院','梧州学院创办于1985年，前身是广西大学梧州分校。2003年10月，广西大学梧州分校与梧州教育学院、梧州师范学校合并组建新的广西大学梧州分校，同时向教育部申报升格为本科院校。2006年2月，',10012,'广西'),(731,1736,'南宁职业技术学院','南宁职业技术学院前身为创建于1984年的南宁职业大学，是由南宁市人民政府举办、区市共建的一所全日制综合性高等职业院校。2009年12月，学校通过教育部、财政部示范建设验收，成为全国首批28所',10012,'广西'),(732,1729,'广西科技师范学院','广西科技师范学院(简称“广西科师”)的前身为创办于1958年的宜山师范专科学校，1959年与柳州市师范专科学校合并后改名为柳州师范专科学校，1960年从宜山搬迁到柳州',10012,'广西'),(733,1046,'广西财经学院','广西财经学院位于广西首府南宁市。2004年5月，经国家教育部批准，由广西财政高等专科学校和广西商业高等专科学校合并组建，是一所以经济管理类学科为主，文学、法学、理学、工学相互支撑、协调发展的地方性',10012,'广西'),(734,1256,'钦州学院','学校地处北部湾顶端的钦州市，是广西沿海唯一一所公立本科院校，是广西唯一一所获得国家高级海船员培养培训资质和国家一级渔业船员培训资质的高校。2011年，广西区政府同意在钦州学院基础',10012,'广西'),(735,1737,'广西水利电力职业技术学院','广西水利电力职业技术学院坐落于中国绿城、全国文明城市、广西壮族自治区首府南宁市，是一所以水利、电力、机电、建筑、计算机与信息等工科类专业为主，经济、管理等人文类专业有机结合的创新型高职学院。',10012,'广西'),(736,1730,'桂林师范高等专科学校','桂林师范高等专科学校于2000年经教育部批准成立，由区市共管、以市管为主。其前身是创建于1938年的广西省立桂林师范学校，具有光荣的革命传统，被誉为“桂北革命的摇篮”',10012,'广西'),(737,1738,'广西职业技术学院','广西职业技术学院前身是创建于1965年的广西劳动大学，先后历经广西农学院热带作物分院(本科)、广西农垦职工大学、广西农工商职业大学等历史阶段。1998年经国家教育部批准，成为广西首批独立改制',10012,'广西'),(738,1732,'桂林旅游学院','桂林旅游高等专科学校创办于1985年，始称桂林旅游专科学校。1994年正式定名为桂林旅游高等专科学校。学校坐落在山水甲天下的国际旅游名城桂林，拥有骖鸾、雁山两个校区，占',10012,'广西'),(739,1259,'贺州学院','贺州学院是广西一所全日制公办普通本科院校。校址位于湘、桂、粤三省（区）交界的美丽的贺州市。学院以培养基础教育师资和地方经济社会发展需要的应用型人才为主要目标，坚持立足贺州、服务周边、面向全国',10012,'广西'),(740,1739,'柳州职业技术学院','柳州职业技术学院是柳州市人民政府举办的一所全日制普通高等学校，坐落在祖国西南工业重镇广西柳州市，是全国100所、广西仅有的2所国家示范性高职院校之一、广西4所首批示范性高职院校之一。',10012,'广西'),(741,1740,'广西生态工程职业技术学院','广西生态工程职业技术学院是广西壮族自治区人民政府举办，广西林业厅、教育厅管理的全日制普通高等学校，学校是自治区示范性高等职业学院、首批国家高技能人才培养示范基地、自治区特色高校、广西珍贵乡土',10012,'广西'),(742,1741,'广西交通职业技术学院','广西交通职业技术学院前身为创建于1958年的国家重点中专广西交通学校，隶属于广西壮族自治区交通运输厅。2002年经自治区人民政府批准，升格为公办全日制普通高等职业院校，是广西唯一一所培养交通',10012,'广西'),(743,1742,'广西工业职业技术学院','广西工业职业技术学院是2003年8月经广西壮族自治区人民政府批准由原广西南宁化工学校和广西轻工业学校合并升格成立的高等职业学校，隶属广西壮族自治区工业和信息化委员会，是教育部高职高专院校人才',10012,'广西'),(744,102,'厦门大学','厦门大学是由著名爱国华侨领袖陈嘉庚先生于1921年创办的，是中国近代教育史上第一所华侨创办的大学，也是我国唯一地处经济特区的国家“211工程”和“985工',10024,'福建'),(745,465,'华侨大学','华侨大学是中国著名高等学府，创办于1960年，校区分别坐落于中国著名侨乡福建省厦门市和泉州市，学校直属国务院侨务办公室领导。华侨大学是国家重点建设的综合性大学。在5',10024,'福建'),(746,103,'福州大学','福州大学是国家“211工程”重点建设高校，福建省人民政府与国家教育部共建高校。创建于1958年，现已发展成为一所以工为主、理工结合，理、工、经、管、文、法、艺等多学科',10024,'福建'),(747,474,'福建工程学院','福建工程学院是福建省人民政府举办的全日制普通本科高校。办学历史溯源于1896年清末著名闽绅林纾、末代帝师陈宝琛创办的“苍霞精舍”，解放前为享有盛誉的“福建',10024,'福建'),(748,468,'福建农林大学','福建农林大学是农业部、国家林业局与福建省政府共建大学，是福建省重点建设的高水平大学和福建省支持建成全国一流大学的高校，在培养高质量人才、开展高水平科学研究、提供高效益的社会服务等方面取得了积',10024,'福建'),(749,471,'集美大学','集美大学是福建省重点建设的八所高校之一。集美大学是一所以教学为主、以本科教育为主、以培养具有创新精神和实践能力的应用型高级专门人才为主，服务于地方经济建设与社会发展的省',10024,'福建'),(750,1020,'福建医科大学','福建医科大学创建于1937年，前身是福建省立医学专科学校，首任校长侯宗濂(1900年-1992年)，系中国近现代著名生理学家和医学教育家。在近80年的办学历程中，学校始终以造就优秀人才、推动',10024,'福建'),(751,1021,'福建中医药大学','福建中医药大学原名福建中医学院，创建于1958年，是我国创办较早的高等中医药院校之一，是福建省重点建设